package loops;

public class ForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int row = 0; row < 4; row++)
		{
			for (int col = 1; col <= 2; col++) {
				System.out.print("row=" + row + "col=" + col);
			}
			System.out.println();
		}

	}

}
